import { useState } from 'react';

const Contact = () => {
  const [formData, setFormData] = useState({ name: '', email: '', message: '' });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Since no backend, just alert or something
    alert('Thank you for your message! I will get back to you soon.');
  };

  return (
    <div style={{ minHeight: '80vh', backgroundColor: '#666', color: '#fff', padding: '2rem', display: 'flex', flexDirection: 'column', alignItems: 'center', animation: 'fadeIn 1s ease-in' }}>
      <h1 style={{ color: '#ff6600', fontSize: '2.5rem', marginBottom: '1rem', textAlign: 'center' }}>Get in Touch</h1>
      <p style={{ color: '#ddd', fontSize: '1.2rem', textAlign: 'center', marginBottom: '2rem' }}>
        I'd love to hear from you! Fill out the form below or reach out via my contact details.
      </p>

      <form onSubmit={handleSubmit} style={{ width: '100%', maxWidth: '600px', backgroundColor: '#555', padding: '2rem', borderRadius: '10px', boxShadow: '0 4px 8px rgba(0,0,0,0.2)', transition: 'transform 0.3s ease' }} onMouseEnter={(e) => e.target.style.transform = 'scale(1.02)'} onMouseLeave={(e) => e.target.style.transform = 'scale(1)'} >
        <div style={{ marginBottom: '1rem' }}>
          <label style={{ color: '#ff6600', fontSize: '1.1rem' }}>Name:</label>
          <input type="text" name="name" value={formData.name} onChange={handleChange} required style={{ width: '100%', padding: '0.5rem', border: 'none', borderRadius: '5px', marginTop: '0.5rem', fontSize: '1rem' }} />
        </div>
        <div style={{ marginBottom: '1rem' }}>
          <label style={{ color: '#ff6600', fontSize: '1.1rem' }}>Email:</label>
          <input type="email" name="email" value={formData.email} onChange={handleChange} required style={{ width: '100%', padding: '0.5rem', border: 'none', borderRadius: '5px', marginTop: '0.5rem', fontSize: '1rem' }} />
        </div>
        <div style={{ marginBottom: '1rem' }}>
          <label style={{ color: '#ff6600', fontSize: '1.1rem' }}>Message:</label>
          <textarea name="message" value={formData.message} onChange={handleChange} required style={{ width: '100%', padding: '0.5rem', border: 'none', borderRadius: '5px', marginTop: '0.5rem', fontSize: '1rem', height: '100px' }} />
        </div>
        <button type="submit" style={{ backgroundColor: '#ff6600', color: '#fff', padding: '0.75rem 1.5rem', border: 'none', borderRadius: '5px', cursor: 'pointer', fontSize: '1rem', transition: 'background-color 0.3s ease' }} onMouseEnter={(e) => e.target.style.backgroundColor = '#e55a00'} onMouseLeave={(e) => e.target.style.backgroundColor = '#ff6600'}>Send Message</button>
      </form>

      <div style={{ marginTop: '3rem', textAlign: 'center' }}>
        <h3 style={{ color: '#ff6600' }}>Contact Information</h3>
        <p style={{ color: '#ddd' }}>Email: <a href="mailto:connect.darshanparmar@gmail.com" style={{ color: '#ff6600', textDecoration: 'none' }}>connect.darshanparmar@gmail.com</a></p>
        <p style={{ color: '#ddd' }}>Phone: +91 8141902382</p>
        <p style={{ color: '#ddd' }}>Location: Bharuch, Gujarat</p>
        <div style={{ marginTop: '1rem' }}>
          <a href="https://linkedin.com/in/dte-gecbh-com-darshan-parmar" style={{ color: '#ff6600', textDecoration: 'none', margin: '0 1rem', transition: 'color 0.3s ease' }} onMouseEnter={(e) => e.target.style.color = '#e55a00'} onMouseLeave={(e) => e.target.style.color = '#ff6600'}>LinkedIn</a>
          <a href="https://github.com/ParmarDarshan29" style={{ color: '#ff6600', textDecoration: 'none', margin: '0 1rem', transition: 'color 0.3s ease' }} onMouseEnter={(e) => e.target.style.color = '#e55a00'} onMouseLeave={(e) => e.target.style.color = '#ff6600'}>GitHub</a>
        </div>
      </div>

      <style>
        {`
          @keyframes fadeIn {
            from { opacity: 0; transform: translateY(20px); }
            to { opacity: 1; transform: translateY(0); }
          }
        `}
      </style>
    </div>
  );
};

export default Contact;
